INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 1, 1, 'und', 0, '<p>Petit test,&nbsp;</p>\r\n\r\n<p>Un assaut dès l’aube\r\nMercredi matin vers 04h20, cinq jours après els attentats meurtriers de Paris, la sous-direction antiterroriste de la police judiciaire et les forces policières d’intervention du Raid ont donc lancé une opération dans cette ville de Seine-Saint-Denis, située à moins d’un kilomètre du Stade de France. Le quartier a été bouclé et plusieurs coups de feu ont été entendus par intermittence.\r\n\r\nL’assaut s’est terminé peu avant 11h30. Au total, 110 policiers du Raid et de la Brigade de recherche ont été mobilisés.\r\n\r\nAbdelhamid Abaaoud dans l’appartement ?\r\nL’homme visé par l’opération du Raid est Abdelhamid Abaaoud, le cerveau présumé des attentats de Paris. Ce jeune Belge, qui est l’une des figures les plus connues parmi les djihadistes francophones, se trouvait aux dernières nouvelles en Syrie.\r\n\r\nSa présence n’a pas été confirmée dans l’appartement de Saint-Denis visé par la police.</p>\r\n\r\n<p>&nbsp;</p>', '', 'full_html'),
('node', 'petite_annonce', 0, 2, 2, 'und', 0, '<p>Le chien (Canis lupus familiaris) est la sous-espèce domestique de Canis lupus, un mammifère de la famille des Canidés (Canidae), laquelle comprend également le loup gris, ancêtre sauvage du chien, et le dingo, chien domestique redevenu sauvage.</p>\r\n', '', 'filtered_html');
